import React from "react";
import '../styles/home.style.css'
import { config } from '../config'
import axios from 'axios'

class Home extends React.Component {

     constructor() {
          super()
          this.state = {
               broadcasters: ['asdasda','xxxx']
          }
     }

     SAFE_componentWillMount(){
          this.GetBroadCasters()
     }
     GetBroadCasters = () => {
          axios.get(`http://${config.NODE_IP}:${config.NODE_PORT}/broadcaster/list`)
               .then(res => {
                    console.log(res.data)
                    this.setState({
                         broadcaster: res.data
                    })
               })
     }

     render() {
          return (
               <div>
                    <h1>Streamer online</h1>
                    <ul>
                         {this.state.broadcasters.map((bc, i) => {
                              return <li key={i}><a href='#'>{bc}</a></li>
                         })}
                    </ul>
               </div>
          )
     }
}

export default Home;
